import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { TelaPerguntasComponent } from './tela-perguntas/tela-perguntas.component';

const routes: Routes = [
  { path: '', component: TelaPerguntasComponent }, // Rota inicial para a tela de perguntas
  // Outras rotas podem ser definidas aqui, se necessário
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
